import React from 'react';
import coca from "../img/coca.jpg"
import fanta from "../img/fanta.jpg"
import sprite from "../img/Sprite.png"
const card = () => {
    return (
        <div className="container">
            <div className="d-flex mx-2">
                <div className="col-4 borderCard ">
                    <img className="tailleImg" src={coca} alt="" />
                    <h2>Coca</h2>
                </div>
                <div className="col-4 borderCard ">
                    <img className="tailleImg"src={fanta} alt="" />
                    <h2>Fanta</h2>
    
                </div>
                <div className="col-4 borderCard">
                    <img className="tailleImg"src={sprite} alt="" />
                    <h2>Sprite</h2>

                </div>
            </div>
        </div>
    );
};

export default card;
